window.bookSummaryJSON = "<p>The race is on to save the world!<br> <br> With their victory in the Golden Lands, Gareth and his friends turn their eye toward their next goal. The activation of two of the eight ancient weapons designed to destroy the gods has set Acamida on a course for destruction.<br> <br> Discovering the rest won’t prove itself easy. Acamida is a dangerous place, and threats lurk around every corner. Continuing his quest won’t prove as easy as Gareth believes, and his complacency threatens to unravel everything.<br> <br> As the countdown to disaster continues to tick down, Gareth is going to discover a side of himself he never expected. Only by getting stronger, finding new cards, and most importantly, becoming more goblin, can he save reality.</p>"; 
